CREATE OR REPLACE TRIGGER arc_fk_arco_cli__db_cli_fisica BEFORE
    INSERT OR UPDATE OF nr_cliente ON db_cli_fisica
    FOR EACH ROW
DECLARE
    d NUMBER(10);
BEGIN
    SELECT
        a.nr_cliente
    INTO d
    FROM
        db_cliente a
    WHERE
        a.nr_cliente = :new.nr_cliente;

    IF ( d IS NULL OR d <> :new.nr_cliente ) THEN
        raise_application_error(-20223, 'FK FK_DB_CLIENTE_FISICA in Table DB_CLI_FISICA violates Arc constraint on Table DB_CLIENTE - discriminator column NR_CLIENTE doesn''t have value NR_CLIENTE');
    END IF;

EXCEPTION
    WHEN no_data_found THEN
        NULL;
    WHEN OTHERS THEN
        RAISE;
END;
/

