-- Script unico e principal que carrega todos os dados 
-- do projeto da Hamburgeria Divine Burger (DBurger)
--
-- inicio da carga: Tabela Estados do Brasil
--

--
-- Carga de Dados: Tabela Cidades do Brasil
--





























--
-- Carga de dados Randomica da tabela DB_LOJA
-- Os conteudos podem variar a cada execucao pois trabalham no conceito de array
--
DECLARE
    TYPE t_loja IS VARRAY(7) OF VARCHAR2(20) NOT NULL;
    t_nm_loja t_loja := t_loja('Dburger VIP ','DBurger Top ', 'DBurger Prime ', 'Dburger Supreme ', 'DBurger DeLuxe ', 'DBurger Premium ', 'DBurger Supreme ');
	v_nr_randomico number(1) := 3;
    v_nr_randomico_ant number(1) := 3;    
    v_nm_loja db_loja.nm_loja%type;
    v_nm_cidade db_cidade.nm_cidade%type;
BEGIN

FOR X IN (SELECT CD_LOGRADOURO FROM  DB_LOGRADOURO)
LOOP

    SELECT  c.nm_cidade
    INTO    v_nm_cidade
    FROM    db_cidade c, db_bairro b, db_logradouro l
    WHERE   c.cd_cidade = b.cd_cidade and b.cd_bairro = l.cd_bairro
    AND     l.cd_logradouro = x.cd_logradouro;

    v_nr_randomico_ant := v_nr_randomico;
	v_nr_randomico := DBMS_RANDOM.VALUE(1, 7);

    IF v_nr_randomico = v_nr_randomico_ant THEN
        IF v_nr_randomico = 7 THEN
            v_nr_randomico := DBMS_RANDOM.VALUE(1, 6);
        ELSE
            v_nr_randomico := v_nr_randomico + 1;
        END IF;
    END IF;
    v_nm_loja := t_nm_loja( v_nr_randomico ) ||	 v_nm_cidade;
 
    VALUES (sq_db_loja.nextval, v_nm_loja , to_date('01/01/2023','dd/mm/yyyy') - (v_nr_randomico*365)); 

	-- Aproveitamos a cidade e vamos associar a loja a esse endereco que pertence a uma cidade.
    VALUES (sq_db_end_loja.nextval, sq_db_loja.currval, x.cd_logradouro, DBMS_RANDOM.VALUE(111, 997), to_date('01/01/2023','dd/mm/yyyy') - ((v_nr_randomico*365)+60), 'A' ); 

END LOOP;

END;
