--
-- Carga de dados Randomica da tabela DB_END_FUNC
-- Os conteudos podem variar a cada execucao pois trabalham no conceito de array
--
DECLARE
    v_nr_randomico number(1) := 3;
BEGIN

FOR X IN (SELECT F.NR_MATRICULA_FUNC, L.CD_LOGRADOURO FROM  DB_FUNCIONARIO F, DB_LOGRADOURO L)
LOOP

	v_nr_randomico := DBMS_RANDOM.VALUE(2, 3);
    VALUES (x.nr_matricula_func, x.cd_logradouro, DBMS_RANDOM.VALUE(147, 933), to_date('01/01/2023','dd/mm/yyyy') - ((v_nr_randomico*365)+60), 'A' ); 

END LOOP;

END;
/

