--
-- Carga de dados do endereco do cliente
--
DECLARE
    TYPE t_cd_logradouro IS VARRAY(99) OF NUMBER(2);
    t_cd_logradouro_cli t_cd_logradouro := t_cd_logradouro(1);
    v_contador number := 00;
    v_limite_logr number;
    v_ds_complemento_end varchar2(80);
BEGIN

FOR X IN (SELECT CD_LOGRADOURO FROM  DB_LOGRADOURO order by 1)
LOOP
    t_cd_logradouro_cli.extend;
    t_cd_logradouro_cli(x.cd_logradouro) := x.cd_logradouro;
    v_contador := v_contador  + 1;
END LOOP;
    v_limite_logr := v_contador;
    v_contador := 1;

    FOR Y IN (SELECT NR_CLIENTE FROM DB_CLIENTE ORDER BY 1 DESC)
    LOOP
    
        values (y.nr_cliente, t_cd_logradouro_cli(v_contador), DBMS_RANDOM.VALUE(123, 852), NULL, sysdate, 'A');

        v_contador := v_contador + 1;
        IF v_contador >=  v_limite_logr then
            v_contador := 1;
        END IF;
      
        IF v_contador in (5,10,15,20,25,30,35,40,45,50,60,70,80,90) then
            v_ds_complemento_end := 'Proximo ao ponto de nibus numero: ' || to_char(v_contador);
        ELSE
			v_ds_complemento_end := '';
        END IF;
        
    END LOOP;

END;
/

