PROCEDURE PRC_CARGA_PEDIDO_DBURGER( p_nr_loja number, p_qt_pedidos in number) AS 

--p_nr_loja number := 1;
--p_qt_pedidos number := 10;

v_dt_pedido_ini date := sysdate-730;
v_dt_pedido_ajustada date;

-- Cria as estruturas do tipo  tables records array (forma pagamento, produto_loja)
type eforma_pagamento 	IS table of db_forma_pagamento.cd_forma_pagto%type  	index by binary_integer;
type ecliente 	        IS table of db_cliente.nr_cliente%type  	            index by binary_integer;
type efuncionario       IS table of db_func_loja.nr_matricula_func_loja%type  	index by binary_integer;
type eproduto_loja      IS table of db_produto_loja.cd_produto_loja%type  	    index by binary_integer;

-- Cria as variavies de tables records forma pagamento, produto_loja
aforma_pagamento eforma_pagamento;
acliente        ecliente;
afuncionario    efuncionario;

-- Cria as variavies de tables records para os itens de vendas por categoria
aproduto_loja_lanche eproduto_loja;
aproduto_loja_bebida eproduto_loja;
aproduto_loja_acompanhamento eproduto_loja;
aproduto_loja_sobremesa eproduto_loja;

-- Cria o collection do pedido DBurger
type tarray is table of db_pedido%rowtype index by binary_integer;
varrayped tarray;

-- Cria o collection do item de pedido DBurger
type tarrayitem is table of db_item_pedido%rowtype index by binary_integer;
varrayitem tarrayitem;


-- Cria um cnotador para o pedido de venda
v_contador  number(10) := 00;
v_contador_item number(10) := 00;

-- Variaveis para uso no item pedido
-- Variavel para criar a quantidade de lanches vendidos (1 a 4), sem contar suco e sobremesa que tera a mesma quantidade
v_qtd_item_pedido number := 00;
v_vl_unitario number := 00;
v_vl_lucro number := 00;
v_nr_item  number := 00;

v_cd_logradouro_cli number;
v_cd_func_motoboy number;

begin
    -- 1o passo: carrega os dados da forma de pagamento em uma table record
   v_contador := 00; -- antes de entrar no loop zera o contador principal.
   for fp in ( select cd_forma_pagto from db_forma_pagamento)
   loop
     v_contador := v_contador + 1;
     aforma_pagamento(v_contador) := fp.cd_forma_pagto;     
   end loop;

	--
    -- Agora vamos carregar na Array os clientes para cada loja
    --
    v_contador := 00; -- antes de entrar no loop zera o contador principal.       
    for cend in 
    (
		select  ec.nr_cliente
		from    db_end_loja el inner join db_logradouro logr
		on (el.cd_logradouro = logr.cd_logradouro) inner join db_end_cli ec 
		on (ec.cd_logradouro_cli = logr.cd_logradouro) inner join db_bairro b
		on (logr.cd_bairro = b.cd_bairro) inner join db_cidade c
		on  (b.cd_cidade = c.cd_cidade) 
		where el.nr_loja = p_nr_loja
    )
   loop
     v_contador := v_contador + 1;
     acliente(v_contador) := cend.nr_cliente;     
   end loop;


    -- Agora vamos carregar na Array os funcionarios q atende o pedido ao cliente:  Gerente (2), Caixa(3) e Garcom (7)
    --
    v_contador := 00; -- antes de entrar no loop zera o contador principal.       
    for cfunc in 
    (
        select 	nr_matricula_func_loja 
        from    db_func_loja fl  
        where 	fl.nr_loja = p_nr_loja
        and 	fl.cd_cargo in (2,3,7)
    )
   loop
     v_contador := v_contador + 1;
     afuncionario(v_contador) := cfunc.nr_matricula_func_loja;
   end loop;

	--
    -- Aqui sao as arrays do item do pedido
	-- Aqui comeca a parte do item de pedido
    -- 1o passo: carrega os dados dos produtos da loja em uma table record
    v_contador_item := 00; -- antes de entrar no loop zera o contador principal.
            
    -- Seleciona Lanche 
    for prlj_l in ( select pl.cd_produto_loja 
					from db_produto_loja pl inner join db_produto p
                    on (pl.cd_produto = p.cd_produto) inner join db_sub_categoria_prod sc
                    on (p.cd_sub_categoria_prod = sc.cd_sub_categoria_prod)
                    where pl.nr_loja = p_nr_loja and sc.cd_categoria_prod = 2)
    loop
                    v_contador_item := v_contador_item + 1;
                    aproduto_loja_lanche(v_contador_item) := prlj_l.cd_produto_loja;     
    end loop;

	
    v_contador_item := 00; -- antes de entrar no loop zera o contador principal
    -- Seleciona Bebida 
    for prlj_b in ( select pl.cd_produto_loja 
                    from db_produto_loja pl inner join db_produto p
                    on (pl.cd_produto = p.cd_produto) inner join db_sub_categoria_prod sc
                    on (p.cd_sub_categoria_prod = sc.cd_sub_categoria_prod)
                    where pl.nr_loja = p_nr_loja and sc.cd_categoria_prod = 1)
    loop
                    v_contador_item := v_contador_item + 1;
                    aproduto_loja_bebida(v_contador_item) := prlj_b.cd_produto_loja;     
    end loop;
            
    v_contador_item := 00; -- antes de entrar no loop zera o contador principal
    -- Seleciona Acompanhamento 
    for prlj_a in ( select pl.cd_produto_loja 
                    from db_produto_loja pl inner join db_produto p
                    on (pl.cd_produto = p.cd_produto) inner join db_sub_categoria_prod sc
                    on (p.cd_sub_categoria_prod = sc.cd_sub_categoria_prod)
                    where pl.nr_loja = p_nr_loja and sc.cd_categoria_prod = 3)
    loop
                    v_contador_item := v_contador_item + 1;
                    aproduto_loja_acompanhamento(v_contador_item) := prlj_a.cd_produto_loja;     
    end loop;
            
            
    v_contador_item := 00; -- antes de entrar no loop zera o contador principal
    -- Seleciona Sobremesa
    for prlj_s in ( select pl.cd_produto_loja 
                    from db_produto_loja pl inner join db_produto p
                    on (pl.cd_produto = p.cd_produto) inner join db_sub_categoria_prod sc
                    on (p.cd_sub_categoria_prod = sc.cd_sub_categoria_prod)
                    where pl.nr_loja = p_nr_loja and sc.cd_categoria_prod = 4)
    loop
                    v_contador_item := v_contador_item + 1;
                    aproduto_loja_sobremesa(v_contador_item) := prlj_s.cd_produto_loja;     
    end loop;

	--
	-- Preparacao para carga na  tabela de Pedido de uma determinada loja
	--
    v_contador := 00; -- antes de entrar no loop zera o contador principal.       
    v_contador_item := 00;

    for x in 1..p_qt_pedidos
	
    loop
	
      -- Para cada linha do loop, carrega o array de pedido de venda com os valores solicitados
      v_contador  := v_contador  + 1; 
            
      varrayped(v_contador).nr_loja               := p_nr_loja;
      varrayped(v_contador).nr_pedido	          := x;

	  -- calcula a data do pedido ajustada a quantidade de pedidos a serem criados pelo parametro
	  v_dt_pedido_ajustada := v_dt_pedido_ini + trunc(((730/p_qt_pedidos)*x));


	  varrayped(v_contador).dt_pedido	:= v_dt_pedido_ajustada;
      varrayped(v_contador).dt_prev_entrega := v_dt_pedido_ajustada;
      varrayped(v_contador).vl_tot_pedido  := 00;
 
 
	  -- seleciona uma forma de pagto randomicamente	
      varrayped(v_contador).cd_forma_pagto	    := aforma_pagamento(dbms_random.value(1, aforma_pagamento.count));
      -- seleciona um cliente randomicamente
	  varrayped(v_contador).nr_cliente	        := acliente(dbms_random.value(1, acliente.count));
      
	  -- Agora selecionamos o codigo do logradouro do cliente pois e uma chave primaria composta
      select cd_logradouro_cli into  v_cd_logradouro_cli
      from    db_end_cli
      where   nr_cliente = varrayped(v_contador).nr_cliente;
      
	  --
      varrayped(v_contador).cd_logradouro_cli	    := v_cd_logradouro_cli;
      --
      varrayped(v_contador).nr_matricula_func_atd	:= afuncionario(dbms_random.value(1, afuncionario.count));
      
	  --
	  -- Em nosso projeto, temos  apenas um entregador por loja inicialmente para realizar a carga
	  -- O codigo cargo 6 e fixo para todos os entregadores do projeto DBurger.
	  begin
		  select 	nr_matricula_func_loja 
		  into 		v_cd_func_motoboy
		  from   	db_func_loja fl 
		  where 	fl.nr_loja = p_nr_loja
		  and 		fl.cd_cargo = 6;
	  exception
		  when others then
			v_cd_func_motoboy := null;
	  end;
	  
      varrayped(v_contador).nr_matricula_func_entrega	:= v_cd_func_motoboy;

    
      if v_contador in (1000,2000,3000,4000) then
         varrayped(v_contador).st_pedido := 'I';
      else
         varrayped(v_contador).st_pedido := 'A';
      end if;

		-- Agora que preparamos a array do pedido vamos tratar do item de pedido
		v_nr_item := 00;   --  Antes de entrar em itens de um novo pedido, iniciamos a variavel
		-- Loop  Principal dos itens q serao criados para cada pedido
		
		-- gera um randomico entre 1 e  3 itens de pedido
		v_qtd_item_pedido  := trunc(DBMS_RANDOM.VALUE(1,3.9),0);
		
		for w in 1..v_qtd_item_pedido 
		loop
				
			-- Lanche      
			v_contador_item := v_contador_item + 1;
			v_nr_item  := v_nr_item  + 1;
			--  dbms_output.put_line( 'NumPed inicio: ' || x|| ' nr item: ' || v_nr_item );
	
			varrayitem(v_contador_item).nr_loja             := varrayped(v_contador).nr_loja;	-- pegamos a loja atual
			varrayitem(v_contador_item).nr_pedido	        := varrayped(v_contador).nr_pedido; -- pegamos o pedido atual
			varrayitem(v_contador_item).nr_item	            := v_nr_item;
			varrayitem(v_contador_item).cd_produto_loja	    := aproduto_loja_lanche(dbms_random.value(1, aproduto_loja_lanche.count));
			varrayitem(v_contador_item).qt_pedido    	    := trunc(DBMS_RANDOM.VALUE(1,3.9),0);
							
			select p.vl_unitario, p.vl_unitario*(p.vl_perc_lucro/100) 
			into v_vl_unitario, v_vl_lucro 
			from db_produto_loja pl 
			inner join db_produto p
			on (pl.cd_produto = p.cd_produto) 
			where  pl.cd_produto_loja = varrayitem(v_contador_item).cd_produto_loja;
							
			varrayitem(v_contador_item).vl_unitario    	    := v_vl_unitario;
			varrayitem(v_contador_item).vl_lucro_liquido    := v_vl_lucro*varrayitem(v_contador_item).qt_pedido;
			varrayitem(v_contador_item).st_item_pedido    	:= 'A';
							
			  
			-- Bebida
			v_contador_item := v_contador_item + 1;
			v_nr_item  := v_nr_item  + 1;
			varrayitem(v_contador_item).nr_loja              := p_nr_loja;
			varrayitem(v_contador_item).nr_pedido	        := x; -- pegamos o pedido atual
			varrayitem(v_contador_item).nr_item	            := v_nr_item;
			varrayitem(v_contador_item).cd_produto_loja	    := aproduto_loja_bebida(dbms_random.value(1, aproduto_loja_bebida.count));
			varrayitem(v_contador_item).qt_pedido    	    := trunc(DBMS_RANDOM.VALUE(1,3.9),0);
							
			select p.vl_unitario, p.vl_unitario*(p.vl_perc_lucro/100) into v_vl_unitario, v_vl_lucro from db_produto_loja pl inner join db_produto p
			on (pl.cd_produto = p.cd_produto) where  pl.cd_produto_loja = varrayitem(v_contador_item).cd_produto_loja;
							
			varrayitem(v_contador_item).vl_unitario    	    := v_vl_unitario;
			varrayitem(v_contador_item).vl_lucro_liquido    	:= v_vl_lucro;
			varrayitem(v_contador_item).st_item_pedido    	:= 'A';
						

			-- Acompanhamento
			v_contador_item := v_contador_item + 1;
			v_nr_item  := v_nr_item  + 1;
			varrayitem(v_contador_item).nr_loja              := p_nr_loja;
			varrayitem(v_contador_item).nr_pedido	        := x; -- pegamos o anterior pois tem um contador acima
			varrayitem(v_contador_item).nr_item	            := v_nr_item;
			varrayitem(v_contador_item).cd_produto_loja	    := aproduto_loja_acompanhamento(dbms_random.value(1, aproduto_loja_acompanhamento.count));
			varrayitem(v_contador_item).qt_pedido    	    := trunc(DBMS_RANDOM.VALUE(1,3.9),0);
							
			select p.vl_unitario, p.vl_unitario*(p.vl_perc_lucro/100) into v_vl_unitario, v_vl_lucro from db_produto_loja pl inner join db_produto p
			on (pl.cd_produto = p.cd_produto) where  pl.cd_produto_loja = varrayitem(v_contador_item).cd_produto_loja;
							
			varrayitem(v_contador_item).vl_unitario    	    := v_vl_unitario;
			varrayitem(v_contador_item).vl_lucro_liquido    	:= v_vl_lucro;
			varrayitem(v_contador_item).st_item_pedido    	:= 'A';
						

			-- Sobremesa
			v_contador_item := v_contador_item + 1;
			v_nr_item  := v_nr_item  + 1;                    
			varrayitem(v_contador_item).nr_loja              := p_nr_loja;
			varrayitem(v_contador_item).nr_pedido	        := x; -- pegamos o anterior pois tem um contador acima
			varrayitem(v_contador_item).nr_item	            := v_nr_item;
			varrayitem(v_contador_item).cd_produto_loja      := aproduto_loja_sobremesa(dbms_random.value(1, aproduto_loja_sobremesa.count));
			varrayitem(v_contador_item).qt_pedido    	    := trunc(DBMS_RANDOM.VALUE(1,3.9),0);
							
			select p.vl_unitario, p.vl_unitario*(p.vl_perc_lucro/100) into v_vl_unitario, v_vl_lucro from db_produto_loja pl inner join db_produto p
			on (pl.cd_produto = p.cd_produto) where  pl.cd_produto_loja = varrayitem(v_contador_item).cd_produto_loja;
							
			varrayitem(v_contador_item).vl_unitario    	    := v_vl_unitario;
			varrayitem(v_contador_item).vl_lucro_liquido    	:= v_vl_lucro;
			varrayitem(v_contador_item).st_item_pedido    	:= 'A';
												
		end loop; -- loop do item de pedido
		
    end loop; -- loop do pedido
	
    -- Descarrega o array populado na tabela de Pedido do DBurger
    forall y in varrayped.first..varrayped.last
	
	 -- Descarrega o array populado na tabela de Item de Pedido do DBurger
     forall y in varrayitem.first..varrayitem.last
	 
	 -- grava o upload da loja
	 commit;
	 
end PRC_CARGA_PEDIDO_DBURGER;

begin
	-- Realiza a carga de pedidos e itens para o projeto DBurger
	prc_carga_pedido_dburger( p_nr_loja=>1, p_qt_pedidos=>2000);
	prc_carga_pedido_dburger( p_nr_loja=>3, p_qt_pedidos=>1000);
