	prc_carga_pedido_dburger( p_nr_loja=>57, p_qt_pedidos=>5000);
	prc_carga_pedido_dburger( p_nr_loja=>61, p_qt_pedidos=>7000);
	prc_carga_pedido_dburger( p_nr_loja=>62, p_qt_pedidos=>2000);
	prc_carga_pedido_dburger( p_nr_loja=>64, p_qt_pedidos=>1000);
